', 1, DATE '2015-09-09', TIMESTAMP '2015-09-24 11:51:58', 1, 1, null, null, null, 5, 0, 0, null, null, null, 'El dominio de la lengua inglesa como herramienta de comunicación internacional, se ha convertido en un requerimiento esencial para estudiantes y trabajadores en cualquier área del conocimiento o sector productivo. Por esta razón, el SENA pone a disposición de sus aprendices el programa de formación complementaria English Dot Works Beginner, el cual se basa en los niveles y referentes del Marco Común Europeo de Referencia para las Lenguas (MCERL) con el fin de ofrecer un programa de formación, estructurado en diez niveles que reúnen una serie de actividades de índole comunicativa. La participación del aprendiz en cada nivel de formación le permitirá ejercitar y afianzar habilidades tales como la comprensión auditiva, la lectura, la conversación y la escritura en inglés.

Centrados en la perspectiva del inglés como una herramienta de comunicación, se presenta el programa de formación English Dot Works Beginner, el cual se enfoca en la identificación, apropiación y uso de estructuras básicas del idioma inglés en un contexto de aprendizaje como lengua extranjera (EFL por sus siglas en inglés), dándole al aprendiz las bases conceptuales y comunicativas para iniciar su proceso de formación bilingüe.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
-Trabajar en equipo.
-Establecer procesos comunicativos asertivos.
-Manejar herramientas informáticas asociadas al área objeto de la formación.', null);
Igualmente, debe estimular de manera permanente la autocrítica y la reflexión del aprendiz sobre el quehacer y los resultados de aprendizaje que logra a través de la vinculación activa de las cuatro fuentes de información para la construcción de conocimiento:
El instructor; El entorno;  Las TIC; El trabajo colaborativo.
Entendiéndose la estrategia metodológica como el conjunto de medios puestos en práctica racionalmente para la obtención de un resultado determinado (Foulquié, 1976, p. 302), el programa de formación English Dot Works, plantea una estrategia metodológica enfocada en la presentación de contextos para la enseñanza del inglés, que lleven al aprendiz a la construcción, mejoramiento de competencias comunicativas y ciudadanas a través del uso de ambientes virtuales, tecnologías de la información, la comunicación, y el aprendizaje por proyectos. 
El programa English Dot Works proporciona escenarios que ejemplifican el uso del inglés en la cotidianidad, permitiendo la construcción del conocimiento de una manera autónoma, apoyándose en la interacción entre las fuentes de información tales como el instructor, el entorno, las TIC y el trabajo colaborativo; dicha propuesta hace de la autoevaluación y de la reflexión, prácticas indispensables.', 1, DATE '2015-09-24', TIMESTAMP '2015-10-02 11:27:15', 1, 1, null, null, null, 5, 0, 0, null, null, null, 'El dominio de la lengua inglesa como herramienta de comunicación internacional, se ha convertido en un requerimiento esencial para estudiantes y trabajadores en cualquier área del conocimiento o sector productivo. Por esta razón, el SENA pone a disposición de sus aprendices el programa de formación complementaria English Dot Works, el cual se basa en los niveles y referentes del Marco Común Europeo de Referencia para las Lenguas (MCERL) con el fin de ofrecer un programa de formación, estructurado en diez niveles que reúnen una serie de actividades de índole comunicativa. La participación del aprendiz en cada nivel de formación, le permitirá ejercitar y afianzar habilidades tales como la comprensión auditiva, la lectura, la conversación y la escritura, en inglés.

Partiendo de la necesidad de establecer un contexto bilingüe (español-inglés) en el entorno cotidiano, se presenta el programa English Dot Works 1 con el fin de continuar el proceso inicial de aprendizaje del idioma inglés como lengua extranjera. El programa English Dot Works 1, contiene herramientas virtuales que permiten el afianzamiento, y uso de componentes lingüísticos y comunicativos de acuerdo a información personal, rutinas, descripción de lugares y personas y descripción de situaciones que están tomando lugar en el momento de habla en la lengua inglesa, contextualizando al aprendiz en ambientes que propongan un uso real del idioma inglés, y mejoren su formación bilingüe.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
-Trabajar en equipo.
-Establecer procesos comunicativos asertivos.
-Manejar herramientas informáticas asociadas al área objeto de la formación.', null);
