El trabajo colaborativo.', 3, DATE '2020-08-12', TIMESTAMP '2020-09-07 14:50:49', 5, 9203, null, null, null, 2, 0, 0, null, null, null, 'El programa de APLICACIONES DE LA NANOCIENCIA Y NANOTECNOLOGÍA EN PROYECTOS DE CIENCIA, TECNOLOGÍA E INNOVACIÓN  se creó dentro de la propuesta Tecnoacademia SENNOVA del SENA, dirigido a estudiantes de educación básica y media de instituciones educativas públicas y privadas, como un escenario de aprendizaje complementando su formación formal, permitiendo a los aprendices generar bases teóricas y prácticas en estas  disciplinas que han emergido con gran fuerza y que han pasado en breve tiempo de ser conocidas por una pequeña parte de la comunidad científica a ser consideradas pilares de la siguiente revolución tecnológica e industrial, recibiendo por ello una mayor atención de diferentes sectores de la sociedad.

La formación en la nanociencia no consiste únicamente en impartir de forma teórica y experimental los avances en las posibilidades de ubicar espacialmente y medir el tamaño de estructuras en esa región sino también de seguir paso a paso y en lo posible manipular y controlar los acelerados procesos dinámicos o de transformación que ocurren en la nana escala.

Al revisar los estándares de competencias curriculares de Ciencias Naturales en Colombia no se evidencia la inclusión de estas temáticas relacionadas con la Nanociencia y la Nanotecnología y, frente a lo poco que se ha hecho en el ámbito de llevar la divulgación de la Nanociencia a la educación desde el bachillerato, es por eso que la tecnoacademia se ha dotado de una infraestructura y profesionales formados en estas áreas, para ofrecer un programa complementario a la formación formal de los aprendices mediante la transferencia de conocimientos por medio de desarrollo de proyectos aplicados que apuntan a la solución de problemáticas sociales conjugando la ciencia con el desarrollo de habilidades blandas.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
