El trabajo colaborativo', 3, DATE '2020-08-18', TIMESTAMP '2020-10-09 10:43:36', 11, 9508, null, null, null, 4, 0, 0, null, null, null, 'El Servicio Nacional de Aprendizaje SENA dentro de sus funciones principales tiene el diseño, promoción y ejecución de programas de Formación Profesional Integral para sectores desprotegidos de la población.  Por lo tanto, en su Plan Estratégico Institucional 2019  2022 uno de sus objetivos es Promover la inclusión social a la oferta institucional con enfoque diferencial, el cual se encuentra alineado con una de las estrategias del Plan Nacional de Desarrollo 2018  2022 y los objetivos de desarrollo sostenibles de la ONU en referencia a la reducción de las desigualdades. Es así como, desde el Gobierno Nacional y la Consejería Presidencial para la Juventud en conjunto con el Servicio Nacional de Aprendizaje SENA se ha desarrollado una estrategia de formación que Inspire, Enfoque y Transforme a los jóvenes del país, orientada a capacitarlos y respaldarlos en la generación e implementación de ideas que aporten a la solución de problemáticas locales y contribuyan al desarrollo de emprendimientos que se consoliden como alternativas viables de generación de valor e ingresos.

De igual manera, esta estrategia busca cerrar brechas económicas y de conocimiento a través de una metodología de entrenamiento disruptivo para apoyar la construcción de proyectos de vida sostenibles; para ello brinda conocimientos, acceso a la información y acompañamiento para generar y fortalecer habilidades que faciliten la apropiación de las competencias propuestas por la industria 4.0 y hábitos que propicien el desarrollo y fortalecimiento de emprendimientos locales sostenibles. Así mismo, plantea un primer pilar el cual es la Inspiración, como proceso humano que cumple la función de motivar a las personas a tomar iniciativas que sin ellas no hubiesen tomado, esta apunta a la necesidad que ha propuesto  la UNESCO  de encontrar nuevos cauces de desarrollo que estimulen la creatividad y la innovación en la búsqueda de un crecimiento y un desarrollo sostenible, equitativos e inclusivos (Unesco,2013). 

Este programa de formación denominado ORIENTACIÓN DEL PROYECTO DE VIDA CON EL USO DE ESTRATEGIAS INSPIRADORAS, brinda elementos conceptuales y herramientas que permita desarrollar la inspiración, creatividad y la innovación, por medio del reconocimiento de valores, intereses, talentos personales, así como de los factores del contexto para fomentar un liderazgo que inspire al joven a fortalecer sus habilidades y llevarlo a una transformación desde lo personal, laboral y empresarial.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
-Trabajar en equipo.
-Establecer procesos comunicativos asertivos.
-Manejar herramientas informáticas asociadas al área objeto de la formación.', null);
