Competencias en Lectoescritura y matemáticas.', 'Sitúa al aprendiz en un lugar central que conlleva a un aprendizaje de construcción paulatina y significativa. Tecnoacademia acoge metodologías acordes a las tendencias educativas, caracterizándose por una enseñanza que conjuga la relación y los procesos facilitador-aprendiz, aprendiz-aprendiz, aprendiz-material didáctico y aprendiz-contexto. De tal forma, la estrategia metodológica cumple con tres cualidades esenciales: actividad, participación y autodirección. Esto permite que el rol protagónico esté centrado en el aprendiz, ya que es él quien construye, asimila y acomoda su conocimiento. El ejercicio del facilitador es contextualizado y ajustado a situaciones y desafíos que obedezcan al mundo real, plasmados en problemáticas, proyectos, retos y preguntas que permitan movilizar el interés y motivación de aprendices en su proceso de aprendizaje. Igualmente, la estrategia metodológica tiene como direccionadores en el quehacer pedagógico del facilitador tres componentes; la ciencia, la tecnología y la innovación; estos se complementan y armonizan con el desarrollo de habilidades del siglo XXI, habilidades comunicativas, mentalidad de emprendimiento y contribuyendo también a los objetivos de desarrollos sostenible.', 3, DATE '2022-02-03', TIMESTAMP '2022-02-07 14:05:06', 27, 9522, null, null, null, 2, 0, 0, null, null, null, 'El programa de Diseño y Desarrollo de Sistemas de Información, se creó como propuesta pedagógica para la Línea de Tecnologías Virtuales de las Tecnoacademias del Sistema de Investigación, Desarrollo Tecnológico e Investigación (SENNOVA) de todo el país; con la finalidad de brindar a los estudiantes de educación básica y media, formación complementaría en el área de Informática diseño y desarrollo de software; basada en diversas metodologías y didácticas de aprendizaje.

Además, brindar al sector productivo nacional en general (debido a que la Industria del Software aplica para la mejora de los procesos productivos en todos los sectores ya sea industria, comercio, servicios, sector primario y extractivo, entre otros), la posibilidad de incorporar personal con altas calidades laborales y profesionales que contribuyan al desarrollo económico, social y tecnológico de su entorno y del país, así mismo ofrecer a los aprendices formación en las tecnologías relacionados con el ciclo de vida del Software incluyendo fases de Análisis, Diseño, Desarrollo, factores muy importantes para la competitividad y el efectivo posicionamiento de esta industria en el país.

Es por esto que el SENA implementa el programa Diseño y Desarrollo de Sistemas de Información, el cual impactará positivamente a los aprendices desde la educación básica y media, permitiendo integrar más fácilmente la mano de obra capacitada al Sector Productivo: impulsando procesos de actualización tecnológica en las empresas, imprimiendo desarrollo tecnológico en el sector y adaptando las empresas a las nuevas tendencias productivas con el fin de incrementar los niveles de competitividad y calidad, formando mano de obra calificada con criterios de calidad.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
-Trabajar en equipo.
-Establecer procesos comunicativos asertivos.
-Manejar herramientas informáticas asociadas al área objeto de la formación.', null);
