-El trabajo colaborativo', 3, DATE '2022-05-20', null, 25, 9509, null, null, null, 9, 1344, 864, null, null, null, 'En materia agroalimentaria, Colombia cuenta con alta disponibilidad de tierras, diversidad en suelos y climas, una gran riqueza en recursos naturales, potencial para mantener la producción durante todo el año y un capital humano creativo, que la definen como un país consumidor y productor importante en la región con la capacidad para la oferta sostenible de alimentos y la proyección de convertirse en una plataforma exportadora.  A futuro, la tarea es avanzar de manera conjunta en el marco de un trabajo interinstitucional público  privado, que fomente modelos de producción eficientes y articulados entre todos los eslabones de la cadena agroalimentaria. Además, la industria de alimentos es uno de los principales motores para el desarrollo rural del país, tiene una relevancia particular ya que está llamada a convertirse en una de las despensas alimentarias del mundo tal como lo afirma la Organización de las Naciones Unidas para la Alimentación y la Agricultura; es ahí donde los alimentos procesados tienen grandes oportunidades.

Por otra parte, a través de la Ley 464 de 2017 y el Plan estratégico de ciencia, tecnología e innovación del sector agropecuario colombiano (PECTIA), se promueve el fortalecimiento de la transformación de productos alimenticios que permiten mejorar capacidades para emprender actividades económicas alternativas, con competencias técnicas en la producción sostenible, la transformación y conservación, comercialización y mejoramiento de la calidad e inocuidad de los alimentos locales, y la seguridad alimentaria e igualmente se fomenta el cambio técnico, la generación de valor y la evaluación periódica de sus resultados respecto de la sostenibilidad, la productividad y la competitividad.

Así mismo, la Ley de emprendimiento (Ley 2069 del 2020): Tiene por objeto establecer un marco regulatorio que propicie el emprendimiento y el crecimiento, y la consolidación y sostenibilidad de las empresas, con el fin de aumentar el bienestar social y generar equidad; de igual manera, el SENA está llamado a impulsar la innovación y el desarrollo empresarial en las comunidades.

Por último, los objetivos de desarrollo sostenible de la ONU de Hambre cero y Consumo y producción responsables, apuntan respectivamente: al aumento de la productividad agrícola y de los ingresos de los productores de alimentos en pequeña escala, mediante un acceso seguro y equitativo a las tierras, a otros recursos de producción e insumos.

El sector alimentico requiere recurso humano cualificado capaz de responder integralmente a la dinámica del sector y la sensibilización de la industria frente a la necesidad del cumplimiento de estándares de calidad e inocuidad, demanda personal con capacidades idóneas en su implementación y seguimiento, que contribuyan con el sector agroalimentario en el cumplimiento de los objetivos de calidad a nivel internacional (Codex Alimentarius) y al Plan Decenal de Salud Pública, que incluyen estrategias como el desarrollo de capacidades técnicas, analíticas y de fortalecimiento de los laboratorios de análisis de alimentos. Es así como, el programa de formación Técnico en Elaboración de Productos Alimenticios permitirá al sector agroalimentario contar con personal calificado para desarrollar actividades de higienización de plantas de procesamiento, fabricación de productos alimenticios inocuos y de calidad, recepción y almacenamiento de materias primas e insumos; al igual que para el registro de la producción, demostrando responsabilidad, honestidad y efectividad en su desempeño.

Actualmente, según la información suministrada en el Sistema Nacional De Información de la Educación Superior (SNIES), las entidades que ofertan programas relacionados con la elaboración de productos alimenticios a nivel nacional son Universidad del Atlántico, Instituto Nacional de formación técnica profesional de San Juan del Cesar, Universidad del Tolima y Universidad de Córdoba.

De igual manera, el reporte del observatorio laboral del SENA para vacantes en la Agencia Pública de Empleo (APE) reporta un incremento del 1,4% en Auxiliares en el procesamiento de alimentos y bebidas, 0.1% de incremento en el nivel de operadores colocados y un 0.7% para auxiliares.
La Cámara de Alimentos de la Asociación Nacional de Industriales (ANDI) menciona que en el año 2021 se aseguraron 284.000 empleos formales y directos, representados en 99,13% por micro, pequeñas y medianas empresas de alimentos. Así mismo, las empresas de la industria de alimentos vienen realizando nuevas inversiones para expandir el negocio, ser más eficientes, aumentando las plazas de empleo y el impacto en las comunidades de su entorno

El SENA a través del Técnico en Elaboración de Productos Alimenticios ofrece el programa con todos los elementos de formación profesional, sociales, tecnológicos y culturales, metodologías de aprendizaje innovadoras, acceso a tecnologías, estructurada sobre métodos más que contenidos, lo que potencia la formación de ciudadanos librepensadores, con capacidad crítica, solidarios y emprendedores, que lo acreditan y lo hacen pertinente y coherente con su misión, innovando permanentemente de acuerdo con las tendencias, cambios tecnológicos y las necesidades del sector empresarial y de los trabajadores, impactando positivamente la productividad, la competitividad, la equidad y el desarrollo del país.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
-Trabajar en equipo.
-Establecer procesos comunicativos asertivos.
-Manejar herramientas informáticas asociadas al área objeto de la formación.', null);
