-El trabajo colaborativo', 3, DATE '2023-07-17', null, 5, 9205, null, null, null, 2, 1440, 864, null, null, null, 'En la publicación de Portafolio del mes de marzo 2022 referencia que, las nuevas tecnologías en los últimos años han tenido una notable aceleración, con base en infraestructura digital (conectividad + centros de datos), evidenciando una transformación digital que requiere talento humano, con capacidades de innovación, para la modernización de múltiples sectores. 

De igual manera, el Mobile World Congress (MWC) realizado en marzo 2022 en la ciudad de Barcelona, muestra que más del 50% del PIB Mundial estará digitalizado abarcando los sectores fundamentales como la salud, la minería, el entretenimiento, la agricultura e industria manufacturera, la seguridad, la banca, el gobierno, liderado por entidades como Microsoft, Macintosh, Cisco, Amazon, Oracle, SUN, Linux, Google y otros, dando lineamientos mundiales en avances tecnológicos. 

A nivel nacional, el boletín técnico de marzo 2022 del DANE, indicó que la actividad económica TIC en Colombia que registró mayor participación dentro del valor agregado del sector TIC,  fue telecomunicaciones con un 44,2%; seguido de los servicios TI con un 34,8%; comercio TIC con 12,4%; contenido y media con 7,8%; manufactura TIC con 0,5%, e infraestructura TIC con 0,3%.con lo cual, se puede  apreciar el crecimiento de la actividad económica TIC, en especial el sector servicios TI. Adicionalmente en  el Congreso Internacional de TIC, Andicom 2021,  realizado en Cartagena,   se plantearon retos para la industria TI como: Optimizar los recursos tecnológicos dentro de las empresas, políticas regulatorias y se destacó la importancia de capacitar a más jóvenes en Colombia en materia de nuevas tecnologías. 

El ranking de los perfiles laborales más solicitados en el sector TIC colombiano, según MINTIC 2021, presenta el estudio de brechas de capital humano para el sector TIC donde indica que se debe armonizar la demanda y la oferta de capital humano para aumentar la fuerza laboral y los perfiles en el sector TIC. 
El reporte señala un aumento de cargos críticos, nuevos perfiles y demanda laboral en el sector TIC en postpandemia.

Resultaba casi inevitable que, tras casi dos años de pandemia, algunos perfiles laborales terminaran por cobrar más importancia que otros. Esa situación no solo aumentó la demanda de ciertos cargos tradicionales del sector de las TIC sino que, incluso, creó la necesidad de abrir nuevas vacantes con perfiles que antes eran poco conocidos.

Bajo este contexto, el SENA ofrece el programa TÉCNICO EN SISTEMAS TELEINFORMÁTICOS para aportar al sector productivo personal con alta calidad de formación profesional integral, con capacidades de liderazgo tecnológico, gestión del servicio TIC, mantenimiento CRU (unidad sustituible por el cliente) de equipos, manejo de la información, infraestructura de redes de datos y conectividad, contribuyendo al desarrollo económico, social y tecnológico del país.', null, null, null, null, '-Formular, ejecutar y evaluar proyectos.
-Trabajar en equipo.
-Establecer procesos comunicativos asertivos.
-Manejar herramientas informáticas asociadas al área objeto de la formación.', null);









VALUES (1, 'TECNOLOGÍAS DE LA INFORMACIÓN Y LAS COMUNICACIONES  GESTIÓN DE LA INFORMACIÓN', 'Las tecnologías de la información y la comunicación son un conjunto de servicios, redes, software, aparatos que tienen como fin la mejora de la calidad de vida de las personas dentro de un entorno. Se asocian a ésta línea tecnológica las tecnologías de hardware y automatización, los componentes electrónicos y subconjuntos funcionales, las tecnologías de la información y las comunicaciones, el diseño y desarrollo de software, de accesibilidad y las competencias bilingües.');

VALUES (2, 'DISEÑO', 'El diseño se define como el proceso previo de configuración mental "pre-figuración" en la búsqueda de una solución en cualquier campo. Es utilizado habitualmente en el contexto de las artes aplicadas, ingenierías y otras disciplinas creativas. Se asocian a esta línea tecnológica las tecnologías de diseño de máquinas y equipos eléctricos automatizados, diseño de productos textiles, diseño de modas, diseño de procesos, diseño de sistemas constructivos y diseño de joyas.');

VALUES (3, 'PRODUCCIÓN Y TRANSFORMACIÓN', 'Comprende la creación y procesamiento/prestación de bienes/servicios, incluida su concepción, procesamiento y transformación en las diversas etapas. Esta línea tecnológica abarca tecnologías agrícolas, pecuarias, agroalimentarias pos-cosecha, de gestión agropecuaria, en cría, explotación agropecuaria, mercadeo, ventas y comercialización, mantenimiento predictivo, preventivo y correctivo, tecnologías de producción industrial, de procesos y sistemas constructivos, de producción limpia, bio-combustibles, energías no renovables, energía eléctrica, de explotación y transformación de minerales, producción de servicios turísticos, de salud, gestión administrativa, administrativas, contables y financieras.');

VALUES (4, 'MATERIALES HERRAMIENTAS', 'La línea de materiales y herramientas se refiere a los recursos utilizados en la alimentación de un proceso productivo, esto es, los factores de producción, y a los objetos (equipos, dispositivos, mecanismos) utilizados a fin de facilitar la realización de dicho proceso. A esta línea tecnológica están asociadas las tecnologías de materiales para la industria, la construcción; así como la biotecnología animal, industrial de alimentos y la vegetal.');

VALUES (5, 'CLIENTE', 'La tecnología orientada al cliente comprende todas las actividades asociadas de la cadena de producción y o provisión de un servicio, que comprometen los procesos que tienen efecto directo en los consumidores finales o intermedios. Esta línea tecnológica abarca las tecnologías asociadas con la investigación, planeación y desarrollo de mercados y medios de la comunicación comercial, la logística industrial, portuaria y comercial, la distribución física internacional, las tecnologías relacionadas con el transporte multi-modal y el comercial marítimo.');









